import React from 'react';
import ShoppingFilled from '@ant-design/icons';

const MyNavbar = () => {
    return (
        <nav>
            <div>
                <h4>My Navbar</h4>
            </div>
            <ul className="">
                <li>Home</li>
                <li>About</li>
                {/* <ShoppingFilled style={{color: 'rgb(254, 254, 254)', font-size: '24px'}} /> */}
            </ul>
        </nav>
    );
}
 
export default MyNavbar;
